В результате инженер по качеству - выпускник кафедры Н2 "Военмеха" это:
- Специалист по проектированию и эксплуатации измерительных приборов и систем;
- Специалист по анализу, оценке, контролю, испытаниям и сертификации продукции;
- Специалист по вопросам планирования, обеспечения, управления и улучшения качества продукции, по разработке, эксплуатации и сертификации систем менеджмента качества, способный выполнять работу по указанным вопросам, практически, в любой отрасли промышленности, что доказано опытом работы выпускников.
